import React from 'react'
import Reviewme from './Reviewme';
import UpdateContactInfo from './UpdateContactInfo';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';

function Home() {


    return (


        <div className='container fw-bold h3'>
            Home
            <BrowserRouter>
                <nav className='d-flex flex-row justify-content-evenly  bg-black text-white font-bold '>
                    <h1>KarakaFamilyHealth</h1>
                    <Link to="/" className='nav-link'>Home</Link>
                </nav>
                <Routes>
                    <Route path='/' element={<Home />} />
                    <Route path='/reviewme' element={<Reviewme />} />
                    <Route path='/updatecontact' element={<UpdateContactInfo />} />
                </Routes>
            </BrowserRouter>

        </div >

    )
}

export default Home
